INSERT INTO Items (itemID, title, description, price, quantity, itemcondition, itemStatus) VALUES
  (222636315486, 'Antique quack medical electrical shock device', 'Here is a small antique crank handle electrical medical quack device. The theory was that electrical shock would cure all.  I''m guessing the age somewhere around the early 1900s. The handle turns fine and the coil spins, I haven''t been able to get an electrical current out of it as yet. The dimensions are:  W12cm  *  H8cm', '95.00', 4, 'New', ''),
  (332236523023, 'Chemical tank inspection lamp, scientific, antique', 'Originated from Huntsman Chemical Laboratories museum collection, Brooklyn, Victoria. Apparatus for checking the internal condition of tanks and/or contents. Operates by viewing into a rubber eyepiece through a metal (most likely brass) tube to a glass prism with an adjustable light.', '195.00', 9, 'New', ''),
  (162658589052, 'VINTAGE COLLECTABLE BOOTS IMPLANTATION INSTRUMENT CHEMICAL CAPONISATION POULTRY', 'Old instrument made in England. Box is a bit tatty but the instrument is very good. No pills in the bottle comes with all instructions very old and collectable.', '199.00', 1, 'New', ''),
