  (302026222579, 'Antique Vintage Odhner Calculator Original 1930s 1940s Swedish Pinwheel Suitcase', 'Up for sale is a Odhner Calculator. It seems to add and subtract ok. I didn''t attempt to pull it apart as I''m not an expert of how to routinely clean/service these.', '500.00', 0, 'New', ''),
  (252850117161, '1871 Chemist Jar from a London window used to identify a Chemist Shop -DELIVERED', 'Inside, it has beenGilded with the coat of arms of Queen Victoria and then painted white to look like it is full of white liquid. It bears the name S MAWSON & THOMPSON LONDON.', '5,501.00', 4, 'New', ''),
  (162681392252, 'German Deutsch antique vintage human anatomical muscular canvas chart signed', 'Antique anatomy chart. resplendant with water stain crease and beautiful linen edges. illustrated and signed by Foedish Krantz. made even more desirable by its aged patina. freight with e-go. Adelaide SA 5000.', '295.00', 9, 'New', ''),
  (263224435210, 'VINTAGE Bulk MEDICAL Supplies Thermometer, Nebuliser, Vernaid Bandage,catgut', 'Vernaid Bandage - Does have some light yellowing from storage, would freshen up with soak and wash. Thermometer in metal case - Allenburys, does not appear to be working. Boxed Glaseptic Nebuliser Parke Davis and Co.', '185.00', 9, 'New', ''),
