  (322780009604, 'Gloria Petyarre-Major Aboriginal Artist', 'Gloria first gained national recognition as an Aboriginal artist working in Batik in the late 1970s and began painting on canvas in 1988. By 1991 she had her first solo exhibition in Sydney followed by an Interational solo exhibition in New York.', '234.27', 5, 'New', ''),
