  (322766518180, 'ABORIGINAL - PAINTING ON CANVAS- ARTIST TOPSY NABANARDI.', 'A fine piece of artwork by aboriginal artist Topsy Nabanardi, canvas stretched on wooden frame, western paint. The painting is her depiction of the Yuelamu Dreaming site on Mount Allan Station, N.T. formed by the honey-ant ancestors during the period known as Dreamtime.', '116.07', 2, 'New', ''),
