  (302466250508, 'Aboriginal Hermannsburg Water Colour', 'Australian Aboriginal, Watercolour by NELSON PANNKA-1960''s

On artist board, in original wooden frame with linen-type matting
Dimensions : 50cm x 15cm.
A rare landscape format by this artist, in original 1960''s style frame. Perhaps a slight softening of the colour, and some brown spotting ( foxing) in the sky area. Overall, a great period feel. Reframing by an expert would certainly add to this piece.

Biographical notes.
PANNKA, Nelson (or Panka)
Born 1935 Died 1971
Language group Luritja Skin Kemarre
Nelson Pannka and brother Claude, along with the Raberaba brothers, the Namatjira family, the Ebatarinjas and Benjamin Landara, were members of the original group of Hermannsburg artist with Rex Batterbee in Central Australia.', '28.52', 6, 'New', ''),
